      function locationUpdated() {
        if (raidmapLoaded) {

          var ctx = c.getContext("2d");
          var img = document.getElementById("raidmap");
          ctx.drawImage(img, 0, 0, 2550, 2261);
          var start = document.getElementById("startLocation").selectedIndex;
          var end = document.getElementById("endLocation").selectedIndex;
          if (start > 0 && end > 0) {
            var path = paths[start - 1][end - 1];
            if (path.length > 0) {
              ctx.beginPath();
              ctx.lineWidth = "12";
              ctx.strokeStyle = "black";
              ctx.moveTo(path[0], path[1]);
              for (var i = 2; i < path.length; i += 2) {
                ctx.lineTo(path[i], path[i + 1]);
              }
              ctx.stroke();
              ctx.lineWidth = "4";
              ctx.strokeStyle = "red";
              ctx.stroke();
            }
          }
        }
      }
      function mapLoaded() {
        raidmapLoaded = true;
        locationUpdated();
      }
      window.onload = function () {
        locationUpdated();
